 @pedroramos1607.  você viu o jogo ?
Que time vc torce ?
Pq eu queria saber se retardar um lateral é pior que toma cotovelada.

 @BrazilianMusicTv  Aprendeu a ler onde? Eu disse que se não houver intenção do toque na mão, o arbitro pode optar por não dar cartão. 
Em nenhum momento eu disse que foi ou não pênalti. 
O pênalti ocorreu, o cartão acredito que não era obrigatório dar.

 @agricultorgamer7432  Nesse replay desses melhores momentos não mostra direito, mas o replay que mostrou durante o jogo deu de entender que foi movimento natural e o braço não tava tão levantado assim e o jogador tentou recolher o braço pra perto do corpo.
O pênalti de fato ocorreu, mas achei exagerado o cartão.
Só pra constar eu nem palmeirense sou, só assisti o jogo porque queria ver o Endrick e Vitor Roque jogando.
